        public static List<string> members
        {
            get
            {
                if (_members.Count == 0)
                {
                    _members = _membersString.Split(',').ToList();
                }
                return _members;
            }
        }

        public static List<string> _members = new List<string>();

        public static bool IsBlocked(Graph graph)
        {
            var notAllowedElements = graph.elements.Where( e =>
            {
                var id = e.GetAnalyticsIdentifier()?.Identifier?.Split('(')[0].Trim();
                var isVs = id?.StartsWith("Unity.VisualScripting.")??false;
                if(isVs)
                {
                    Debug.LogWarning("VS node: " + id + " is allowed, skipping");
                }
                return !(id == null || isVs || members.Contains(id));
            });
            foreach(var element in notAllowedElements)
            {
                Debug.LogError("Element not allowed: " + element.GetAnalyticsIdentifier()?.Identifier?.Split('(')[0]);
            }
            return notAllowedElements.Count() > 0;
        } 
    }
